import React from 'react'

const Home = () => {

  const [show , setShow] = useState(false);

  const funct =() =>{
     setShow(!show);
     console.log(show);
  }
  return (
    <>
       <Header fun={funct} />
            <Line />
            <Navbar
             show={show}
             showFunction={setShow}
             />

      <Section1 /> 
    </>
  )
}

export default Home;
